import React, { Component } from 'react';

class Cadastro extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: '',
      age: '',
      email: '',
    }
  }

  render() {
    return (
      <div>
        <form onSubmit={ this.submitHandler }>
          <label htmlFor="name">
            Nome:
            <input type="text" name="name" id="name" onChange={ this.inputHandler }/>
          </label>

          <label htmlFor="age">
            Idade:
            <input type="number" name="age" id="age" onChange={ this.inputHandler }/>
          </label>

          <label htmlFor="email">
            Email:
            <input type="email" name="email" id="email" onChange={ this.inputHandler }/>
          </label>

          <button type="submit" disabled={ isButtonDisabled }>Entrar</button>
        </form>
      </div>
    );
  }
}

export default Cadastro;
